g2:c.PROCEDURE.g2:a.TEXT:
{ This procedure is a "secret" procedure that returns a string and is used for auth security.  This procedure is called from gsi when a new connection is created.  This procedure is set up to run while reset. }

_g2com-rpc-internal-convert() = (text, text)
    localVer : text ;
begin
  localVer = call _g2com_kb_ver() ;
  return "SDF33sDS323''a@[ep", localVer
end

g2com-start-over-interface(ComName: text, ComArguments: item-or-value, InterfaceClass: symbol)

Int: class gsi-interface;
Args: item-or-value;

begin
 { We want the lower bound to start at 1, not zero }
  if ComArguments is a sequence then Args = structure(com-lower-bounds: 1, com-elements: ComArguments) else Args = ComArguments;
  for Int = each object that is of the class named by InterfaceClass do
    start g2com-start(ComName, Args) across Int;
  end;
end

_g2item_create(newitem : class item) = (text, class item)
    intrfc : class gsi-interface;
begin
    intrfc = call g2-current-remote-interface();
    if the create-handler x of intrfc exists and x is a symbol and the procedure named by x exists then start the procedure named by x(newitem);
    return the uuid of newitem, newitem
end

_g2item_inner_update(uuidin:text, axlitem: class item, delit : truth-value ) = (integer)
    g2item, itX: class item ;
    g2ia, aia : item-or-value;
    g2atn, axlatn: symbol ;
    stat : integer ;
    subuuid : text ;
    erX : class error ;
begin
     if there exists an item g2item such that (the uuid of g2item = uuidin and the class of g2item = the class of axlitem) then
        begin
            for g2atn = each symbol that is a user-defined attribute name of g2item  do
                if the item-or-value aia that is an attribute of axlitem named by g2atn exists then
                        begin
                        if aia is an item then
                            begin
                            itX = the item that is an attribute of g2item named by g2atn;
                            subuuid = the uuid of itX ;
                            stat = call _g2item_inner_update (subuuid, aia, false)
                            end
                        else
                            begin
                            conclude that the item-or-value that is an attribute of g2item named by g2atn = aia
                            end
                        end
            else
                return -1
            end;
        if the name of axlitem exists then change the name of g2item to the name of axlitem;
            if the g2-user-mode of g2item exists and the g2-user-mode of axlitem exists then
                    conclude that the g2-user-mode of g2item = the g2-user-mode of axlitem ;
        if the value-structure of axlitem exists and the value-structure of g2item exists then conclude that the value-structure of g2item = the value-structure of axlitem ;
        if delit then 
            delete axlitem;
        return 0
        end;
    return -1 
end on error (erX)
    return -1
end

__g2com_selection_event(event:symbol, user-data: item-or-value, handle: integer, itm: class item)=()
    found : truth-value;
    ifo : class gsi-interface;
    erobj : class error;
begin
   ifo, found = call g2-get-hash-table-value (_g2com-selection-hash-table, handle) ;
    if found then
        start _g2com-trigger-selection-event(handle, user-data) across ifo
    else
        start g2-clear-hash-table-value (_g2com-selection-hash-table, handle) 
end 
on error (erobj)
        start g2-clear-hash-table-value (_g2com-selection-hash-table, handle);
        delete erobj
end

_g2item_update(uuidin:text, axlitem: class item) = (integer)
    stat : integer ;
begin
    stat = call _g2item_inner_update(uuidin, axlitem, true);
    return stat
end

{ We use a procedure to return the kb version instead of putting }
{ it into a parameter so that text stripping can be used to hide it.  }

_g2com_kb_ver() = (text)
    g2com_ver_string : text = "8.2r1b";
begin
    return g2com_ver_string
end
